import React from "react";

const Logo = (props) => {
 function logWhenClicked() {
   console.log("Button was clicked!");
 }
  return (
    <header>
      <h1>{props.appName}</h1>
      <span>{props.appName}</span>;
      <img  src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/006.png"></img>
    </header>
  );
};



export default Logo;
